import React, { useState } from 'react';
import {
  Container, TextField, Button, Typography, Box, Grid, Paper
} from '@mui/material';
import axios from 'axios';

const URLShortener = () => {
  const [inputs, setInputs] = useState([{ url: '', validity: '', shortcode: '' }]);
  const [results, setResults] = useState([]);

  const handleChange = (index, field, value) => {
    const newInputs = [...inputs];
    newInputs[index][field] = value;
    setInputs(newInputs);
  };

  const handleAdd = () => {
    if (inputs.length < 5) {
      setInputs([...inputs, { url: '', validity: '', shortcode: '' }]);
    }
  };

  const handleSubmit = async () => {
    const responses = [];

    for (const input of inputs) {
      if (!input.url || !/^https?:\/\/.+\..+/.test(input.url)) {
        alert('Invalid URL: ' + input.url);
        continue;
      }

      try {
        const res = await axios.post(
          `${process.env.REACT_APP_API_URL || 'http://localhost:4000'}/shorturls`,
          {
            url: input.url,
            validity: input.validity ? parseInt(input.validity) : undefined,
            shortcode: input.shortcode || undefined
          }
        );
        responses.push(res.data);
      } catch (err) {
        responses.push({
          error: err.response?.data?.message || 'Something went wrong'
        });
      }
    }

    setResults(responses);
  };

  return (
    <Container maxWidth="md" sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>URL Shortener</Typography>

      {inputs.map((input, index) => (
        <Box key={index} component={Paper} p={2} my={2}>
          <Grid container spacing={2}>
            <Grid item xs={12} sm={6}>
              <TextField
                fullWidth label="Original URL" value={input.url}
                onChange={(e) => handleChange(index, 'url', e.target.value)}
              />
            </Grid>
            <Grid item xs={12} sm={3}>
              <TextField
                fullWidth label="Validity (minutes)" value={input.validity}
                onChange={(e) => handleChange(index, 'validity', e.target.value)}
              />
            </Grid>
            <Grid item xs={12} sm={3}>
              <TextField
                fullWidth label="Custom Shortcode" value={input.shortcode}
                onChange={(e) => handleChange(index, 'shortcode', e.target.value)}
              />
            </Grid>
          </Grid>
        </Box>
      ))}

      <Box mt={2}>
        <Button variant="outlined" onClick={handleAdd}>Add More</Button>
        <Button variant="contained" sx={{ ml: 2 }} onClick={handleSubmit}>Shorten</Button>
      </Box>

      <Box mt={4}>
        <Typography variant="h5">Results:</Typography>
        {results.map((res, i) => (
          <Box key={i} mt={1}>
            {res.error ? (
              <Typography color="error">{res.error}</Typography>
            ) : (
              <Typography>
                <a href={res.shortLink} target="_blank" rel="noreferrer">{res.shortLink}</a><br />
                Expires at: {res.expiry}
              </Typography>
            )}
          </Box>
        ))}
      </Box>
    </Container>
  );
};

export default URLShortener;
